int pack(const vector<int> &x)
{
  int h = 0;
  for (int i = 0; i < x.size(); ++i) {
    h = h * 3 + x[i];
  }
  return h;
}

vector<int> unpack(int h)
{
  vector<int> ret;
  while (h) {
    ret.push_back(h % 3);
    h /= 3;
  }
  while (ret.size() < 9) ret.push_back(0);
  reverse(ret.begin(), ret.end());
  return ret;
}

